    def lengthOfLongestSubstring(self, s):
        """
        :type s: str
        :rtype: int
        """
        max_len = 0
        if s is None or s == "":
            return max_len

        str_dict = {}
        one_max = 0
        start = 0

        str_length = s.__len__()
        for i in range(str_length):
            # 一个向右滑动的窗口，看当前字符
            if s[i] in str_dict and str_dict[s[i]] >= start:
                start = str_dict[s[i]] + 1  # 记录当次循环中，有重复的（自己的或别的元素的）最右位置
            # start以左为初始位置或有重复
            one_max = i - start + 1
            str_dict[s[i]] = i
            max_len = max(max_len, one_max)
        return max_len


